import React from 'react'
import './Stories.css'

function Stories(){
    return(
        <>
         <div className="card">
            <div className="card-body">
              <img className="card-img-top" src="https://images.fineartamerica.com/images/artworkimages/mediumlarge/1/deeply-rooted-i-shadia-zayed.jpg" alt="Card cap" />
              <button type="button" class="btn btn-outline-dark">Dark</button>

                {/* <a href="#" className="btn btn-primary">Go somewhere</a> */}
            </div>
        </div>
        </>
    )
}
export default Stories
